(1, 1, 2, 2, 0, '202.29.184.143', 1359532921, 1, 0, 1, 1, 1, 1, '', 'ยินดีต้อนรับเข้าสู่ เว็บบอร์ด ', 'นี้คือโพสตัวอย่างในการติดตั้ง phpBB3 ของคุณ ทุกสิ่งดูเหมือนจะทำงานเป็นปกติ คุณสามารถลบโพสนี้หากคุณต้องการและดำเนินการตั้งค่าบอร์ดของคุณ ระหว่างขั้นตอนการติดตั้งหมวดหมู่และบอร์ดแรกของคุณถูกกำหนดให้เหมาะสมและได้รับอนุญาตสำหรับกลุ่มผู้ใช้, ผู้ดูแลระบบ, บอท, ผู้ดูแลบอร์ด, ผู้เข้าชม, สมาชิกที่ลงทะเบียน และผู้ใช้ COPPA ที่ลงทะเบียน ถ้าหากคุณเลือกที่จะลบบอร์ดและหมวดหมู่แรกนี้, อย่าลืมที่จะกำหนดความสามารถการใช้งานของกลุ่มผู้ใช้เหล่านี้สำหรับหมวดหมู่และบอร์ดใหม่ที่คุณสร้าง เราขอแนะนำให้คุณเปลี่ยนชื่อหมวดหมู่และบอร์ดแรกนี้และคัดลอกการอนุญาตใช้งานจากมัน ขณะที่คุณสร้างหมวดหมู่และบอร์ดใหม่. ขอให้โชคดี!', '5dd683b17f641daf84c040bfefc58ce9', 0, '', '', 1, 0, '', 0, 0, 0),
